"vacation_message": null,
"sale_message": "Thanks so much for your order from Paw & Claw Designs! I look forward to sending your new jewelry to you ASAP! \r\n\r\nIf you have not already done so, please remit your PayPal payment to pawandclawdesigns@yahoo.com immediately.\r\n\r\nIf you need express shipping please let me know before you pay and I&#39;ll send you an adjusted invoice.\r\n\r\nIf you should have any questions or concerns about your order, please contact me and I will get back to you as soon as I can. \r\n\r\nTHANKS AGAIN!\r\n\r\n-Kitten\r\nPaw & Claw Designs LLC",
