"login_name": "pawandclawdesigns",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to the shop policies for Paw & Claw Designs.\r\n\r\nPlease take a moment to read the policies listed below, and then browse my shop to make your selections from my line of handmade bead and wire jewelry for one-of-a-kind people with one-of-a-kind taste!\r\n\r\nShould you have any questions or special requests, please do not hesitate to click on “contact pawandclawdesigns” to send me a message. You may also contact me via email at kittenspawn[!at] yahoo.com. I will reply to your request promptly.\r\n\r\nThanks for stopping by!",
"policy_payment": "Accepted payment methods are Credit Card, Etsy Gift Card, PayPal or Google Checkout ONLY. I do not accept Money Orders or Checks.\r\n\r\nWI Residents will be charged 5.5% sales tax on all orders. Payment will automatically be corrected to reflect the correct sales tax amount when you pay for your purchase.\r\n",
"policy_shipping": "All Items come gift wrapped, ready for gift giving right away. Whenever possible, I will use clean recycled packaging materials with the exception of bubble mailers. Your order will always ship in a new bubble mailer unless you request a used mailer. I do not include packing slips or receipts unless requested.\r\n\r\nUS residents who pay via PayPal; Your order will ship via PayPal shipping, so please be sure your PayPal address is correct. \r\n\r\nUS residents who pay directly; Your order will ship via Etsy Shipping. Please be sure your shipping address is correct.\r\n\r\nUS residents will be able to check a packaged delivery via the USPS website at http://usps.com with the delivery confirmation number that will be provided to you by PayPal or Etsy when I ship your order.\r\n\r\nDomestic shipments are sent USPS First Class Mail, and includes Delivery Confirmation.\r\n\r\nInternational Shipments are sent First Class/Air Letter Post and are unfortunately not traceable at this time. Please note that you may be responsible for customs fees when you receive your order from your local postal service. I WILL NOT falsify USPS forms to lower any customs fees you may have to pay. This is a federal offense.\r\n\r\nInsurance is available on request at the buyers expense and based on the cost of the item. (Subject to availability outside the US.)\r\n\r\nLost, damaged, misdirected, undelivered packages will not be replaced if uninsured, unless under special circumstances, which will be reviewed on a case-by-case basis.\r\n\r\nIn rare cases, it may take up to 3 business days to ship your order. I will notify you of any shipping delays greater than 48 business hours. I generally cannot ship weekends due to limited local USPS hours, so if your order is placed after noon on Friday, it will ship the following Monday.\r\n\r\nIf you&#39;d like your order shipped to a gift recipient, I will be happy to do this. Please let me know in the notes to seller if you need this service. I can include a small handmade note at your request.",
"policy_refunds": "Due to the nature of the product and hygiene concerns, all earrings sales are final. The only exception is on earrings in which the ear wires can be changed for unworn wires. The buyer making the return will be responsible for the ear wire replacement cost and any return shipping costs.\r\n\r\nI stand behind my work and want you to be happy. If at any time you&#39;re not happy with an item, simply return it in like new condition, and I will gladly refund your full purchase price within 3 business days of my receipt of the item. The buyer will be responsible for return postage costs.\r\n\r\nPlease do not hesitate to contact me prior to placing your order if an item is not quite &quot;perfect&quot; for you. I&#39;m more than happy to make it perfect. Ear wires can change to a different style or metal, color of beads can be changed or an entirely custom piece can be designed just for you to meet your unique needs! Additional fees and production time may apply.\r\n\r\nResizing and metal upgrades are often available. Please request these upgrade before you order your handmade jewelry to avoid returns or exchanges. (Subject to additional fee and material availability.)\r\n\r\nFor more details about a product, please select &quot;contact&quot; on the item page and I will get you the information you need.",
"policy_additional": "**************************************************\r\nWHOLESALE/BULK ORDERS\r\n**************************************************\r\n\r\nCustom and Wholesale inquiries are always welcome. Please click on &quot;contact&quot; or via email at kittenspawn[!at] yahoo.com to request more information.\r\n\r\n**************************************************\r\nTRADING\r\n**************************************************\r\n\r\nFellow sellers, I am willing to trade items in my shop for items in your shops of equal listed price. If you see an item you like, please send me a message to ask about a trade. My trading process entails us both purchasing the desired item, and cross shipping the corresponding trade item as payment with delivery confirmation service at the shippers expense. I reserve the right to refuse any trade requests, and grant you that same right to refuse any requests I may send to you.\r\n\r\n**************************************************\r\n METALS USED IN MY JEWELRY\r\n**************************************************\r\n\r\nSterling Silver is 92.5% Silver/7.5% Copper\r\n\r\nFine Silver is 99.9% Silver\r\n\r\nPlated (Gold or Silver) is Surgical Steel, Brass or Copper Base and nickle free.\r\n\r\nCopper Wire is C.D.A. # 110; Min 99.9 % purity.\r\n\r\nYellow Brass Wire is C.D.A. # 260; 70% Copper/30% Zinc.\r\n\r\nRed Brass Wire is C.D.A. # 230; 85% Copper/15% Zinc.",
