"title": "Labyrinth Leathercraft",
"announcement": "Every item here is designed and handcrafted by my husband and I out of quality leather from Spain and Italy.  We use organic and water-based treatments wherever possible, making our products fully biodegradable and natural (except the metal bits!).  We believe in making products that last, so every item is 100% solid leather, not filled with dryer fluff from China!\r\n\r\nThanks for visiting and supporting those of us who craft :-)\r\n\r\n\r\n",
