"vacation_message": "Unfortunately, Canada Post is now on strike, meaning that we are unable to send packages via our usual methods.  Because of this, we are putting our webstores on hold, but if you are willing to pay for a courier service such as FedEx or UPS, please contact us and we will make arrangements.  Please continue to check back as the strike could end at any time and we will immediately resume business if that occurs.  Thank you for your patience.  *All orders previously placed have been sent and should not receive delays, but please contact us if you find that your package is late*",
