"policy_welcome": null,
"policy_payment": "Our preferred method of payment is the wonderfully convenient Paypal.  The &quot;Other&quot; option which appears in our payment choices is reserved for trades or other special circumstances.  If you need to pay via cheque or money order, please contact us first and take note that we will not send the purchased items until the cheque or money order clears.\r\n\r\nIf I don&#39;t receive notification of your payment via Paypal within 24 hours, expect us to follow up to touch base.  If we have yet to receive payment within 3 days and and have had no response to our inquires, we will be forced to cancel the sale and repost the item.",
"policy_shipping": null,
"policy_refunds": "If there is a flaw in our workmanship beyond the expected minor variations that give handmade goods their charm, we will accept a return for full refund as long as the item is received within 30 days from the purchase date.  If it is received later than 30 days from the purchase date, but no later than 60 days, we will offer a store credit or exchange for a comparable item.\r\n\r\nIf the return is motivated by a concern other than workmanship, such as the sizing not fitting, we offer a store credit or exchange if the item is received in saleable condition within 30 days of the purchase date.  The only exception to this is that belts made to custom sizing (sizing in between or outside our normal size range of 32&quot;, 34&quot;, 36&quot;, 38&quot;, 40&quot;, 42&quot;, 44&quot;, and 46&quot;) cannot be returned for sizing reasons, so please make sure of your sizing and ask us if you need help to do so!\r\n\r\nIn case of a return, if the reason is a flaw in our product, we will cover shipping in both directions if needed.  In the case of a return for other reasons, such as sizing, you will cover both shipping costs.  If you are in a remote area or another circumstance that would result in obscene shipping costs to send us the item in time, contact us regarding using slower, less expensive shipping within 1 week prior to the end of the return window and we can discuss arrangements.",
"policy_additional": "We welcome custom orders!  If your vision isn&#39;t best suited to our expertise, we are also always happy to direct you to other leatherworkers whose talents would be better suited, so don&#39;t be afraid to ask!\r\n\r\nWe also offer wholesale pricing for other vendors - contact us for details.  Note that we do not at this time accept commission arrangements except with local vendors.",
