"title": "Handmade Genuine leather Drawstring Panel Bag (Aged Green with Accent Medium)  FREE SHIPPING anywhere",
"description": "~Reduced n&#39; Ready~\r\nAll Ready-to-Ship items are 20% off! Use &quot;RnR20&quot; at checkout to redeem!\r\n\r\nFREE SHIPPING Anywhere - Select items (such as this one) are now available for FREE shipping to anywhere the USPS will deliver in the US or internationally!\r\n\r\nSeven pieces all cut, pierced and sewn by hand, this bag is created using a my own pattern I designed for it. Each one of these has approximately 3-4 hours of work into them (4-5 with accenting), with each stitch crafted by meticulous healer&#39;s hands. I am quite proud of this little beauty, and it still remains one of my most popular items at events, and through orders all over the world.\r\n\r\n~~~LIMITED QUANTITY~~~\r\nDue to supply stock and other matters, this item is at risk of running out quickly.\r\nWhat this means for you - if you like this item, don&#39;t delay ordering it, as all orders of this stock are first-come, first-serve, and when it&#39;s gone, it may never return!\r\n\r\nPerfect for carrying your collection of crystals, gaming dice, change, etc!\r\n\r\nCurrent reviews for this item:\r\n~Anymous~\r\n&quot;The Drawstring Bag we ordered arrived today. Very fast shipping! The color of the bag is a beautiful green and the artistry of the bag is fantastic. The hand stitches are perfect. Thank You!!!!!&quot;\r\n\r\nThis customer further described their satisfaction with \r\n&quot;It is the perfect color and made so very well. The bag did meet and exceed our expectations.&quot;\r\n\r\nThese bags have been a hit at past events, and currently remain one of my most highly appraised designs. Taking a shape similar to an orb when closed, they are both beautiful and functional with their long drawstring cords that can easily tie in a bow or be used as small purse/hand bag. As far as durability… well, this general model of bag has been field tested swinging on the arm of a rather energetic 4 year old child and survived perfectly! A customer reported that after 2 years of use for carrying dice (the ones pictured, in fact) the bag is still holding up perfectly (despite some rough treatment and tossing on their part.)\r\n\r\nAs for usefulness? You can fit a variety of little nicknacks in this design, including but not limited to: rune stones,gaming dice (dungeons and dragons, warhammer, etc), tokens, crystals, folded bills, herbs, up to a couple 1 oz bottle of oil (or a couple 1/2 or several 1/3 oz or 1-2 dram bottles), thread, bobbins (and other sewing goodies)\r\n\r\nPlease read our policies for any questions you might have, including shipping, Made-To-Order, etc.\r\n\r\n~PLEASE TAKE NOTE~\r\nWhen shipped, this item will be inside out (this makes it ship easier/quicker), and will need to be turned right side out before initial use.\r\n\r\nThe &quot;Free Shipping&quot; is for domestic orders only; however, the international rates are reduced.\r\n\r\nThese pictures are intended as representative images only. Individual pouches may vary slightly in appearance. Please keep in mind that leather is a natural product and no two hides are alike. Likewise, any markings or color variations are unique characteristics and are not to be considered defects.",
