"title": "Notebooks, leather, bags, unique, custom, and much more",
"announcement": "~Reduced n&#39; Ready~\r\nAll Ready-to-Ship items are 20% off!  Use &quot;RnR20&quot; at checkout to redeem!\r\n\r\nFREE SHIPPING Anywhere -  Select items are now available for FREE shipping to anywhere the USPS will deliver in the US or internationally!  Please note that some Free shipping items are still only free to domestic US addresses due to the nature of their shipping.\r\n\r\nHandmade Notebooks, genuine leather pouches & bags, hand-crafted wooden daggers, swords, wands, etc.  Custom orders welcome!  Most of the items I list will vary in exact color between individuals, but as a basic rule, most any item I list can be replicated and/or custom ordered. \r\n\r\nI specialize in designs that are both varied in purpose, as well as more specific intents/culture/faiths/hobbies, including but not limited to:\r\nCeltic, Pagan,  New Age, Wicca, table top role play, D&D (Dungeons and Dragons), Steampunk, Gothic, Renaissance, Dagorhir, Medieval, collection (crystal, stone, rune, herb, etc)\r\n\r\n~Just a few reviews my work has received~\r\n&quot;The Drawstring Bag we ordered arrived today. Very fast shipping! The color of the bag is a beautiful green and the artistry of the bag is fantastic. The hand stitches are perfect. Thank You!!!!!&quot;\r\n\r\n&quot;Seller was very helpful with my concerns about a tight shipping timeline. Item arrived early and was perfect !!! Fabulous transaction!&quot;\r\n\r\n&quot;It&#39;s PERFECT! Such awesome quality and super fast shipping. Thank you!&quot;\r\n\r\n&quot;Beautiful bag! It&#39;s very well crafted and arrived in a timely manner. Definitely a good seller!&quot;\r\n\r\n&quot;Great Communication, and the bag is perfect. Thank you so much&quot;\r\n\r\n&quot;Thank you very much! ^_^ It&#39;s a beautiful bag and I know my husband is going to love it! ^_^ Thank you for making this a perfect purchase! ^_^&quot;",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for purchasing from Silverfox Crafts!  Please be sure to review shop policies with your order, and don&#39;t hesitate to ask any questions you may have ^_^  Enjoy your purchase!  \r\n\r\nDon&#39;t forget to like Silverfox Massage & Crafts on Facebook for all the latest updates!",
