"login_name": "SilverfoxCrafts",
"accepts_custom_requests": true,
"policy_welcome": "Welcome! Thank you for visiting Silverfox Crafts!  Dedicated to hand-crafting pieces both beautiful and functional, we pride ourselves in detailed, ethical work, and look forward to the honor of exceeding your expectations!\r\n\r\nAs for what we make… \r\nHandmade Notebooks, genuine leather pouches & bags, hand-crafted wooden daggers, swords, wands, etc. Custom orders welcome! \r\n\r\nI specialize in designs that are both varied in purpose, as well as more specific intents/culture/faiths/hobbies, including but not limited to:\r\nCeltic, Pagan, New Age, Wicca, table top role play, D&D (Dungeons and Dragons), Steampunk, Gothic, Renaissance, Dagorhir, Medieval, collection (crystal, stone, rune, herb, etc)\r\n\r\nMost of the items listed will vary in exact color between individuals, but as a basic rule, most any item listed can be replicated and/or custom ordered. Feel free to check out our shop policies, and contact us directly with any questions!",
"policy_payment": "Payments are accepted through Paypal, and direct checkout through Etsy.\r\nPlease note:\r\n ~ Item(s) will not be shipped until payment has cleared",
"policy_shipping": "Shipping is done vie USPS, though other methods are available if requested.\r\n\r\nMade-To-Order items may require additional processing time before shipping, otherwise, shipping is generally 3-5 business days (please review Made to Order policies in Additional Policies and FAQ section below)\r\n\r\nPlease note that buyers are responsible for any and all duties and customs charges that may be incurred.",
"policy_refunds": "Items are generally made-to-order, and may require up to 2 weeks for completion.  During the Autumn season (August-December) orders may take up to 3 weeks depending on work volume.\r\n~Custom orders may take additional time depending on the details involved.\r\n~Descriptions are written as detailed as possible with accurate measurements and references where possible, please understand that when you place an order, you are accepting these factors.\r\n~If you need your order by a specific time, please message first to let me know.\r\n\r\nFailure to adhere to these outlines will result in a denial of requested refund.  However, if the item was paid for, it will be sent.",
"policy_additional": "If you see a design you like, but would prefer a different color(s), please forward such requests to Silverfoxcrafts (yahoo.com) so that we may communicate to find your perfect piece and get it ready for you! ^_^\r\n\r\n~Warranty~\r\nSimplified version:   “To put it more simply... if it breaks (without being abused), I&#39;ll fix it or replace it within reason.”\r\nThe Nitty-gritty…\r\nThe basic of the warranty covers the product from defects in workmanship and materials within certain guidelines and through normal intended use. If your item doesn&#39;t hold up within such guidelines, then we will repair or replace it  (Shipping and handling fees may apply, claims that do not fall under said guidelines may still be eligible for a limited coverage with case-specific fee.)  \r\n\r\nReturns are accepted under appropriate conditions as determined by seller.  Exchanges are accepted with the shipping at the buyer&#39;s expense.\r\n\r\nMade to order items:\r\nPlease allow 2 to 3 weeks for made to order items.  \r\nPlease also note that during the Autumn season, orders may take up to 4 or 5 weeks depending on volume and supply due to this being the time of year that I am also vending at many fairs and festivals.\r\n\r\nRush Order Processing:\r\nIf you need your Made-to-Order item quicker, please consider contacting to request that a &quot;Rush Processing&quot; be placed on your order.   Please note the following details:\r\n&gt; Availability will vary by order volumes.\r\n&gt; This does NOT cover expedited shipping, it is ONLY to push up production time.\r\n&gt; 2$ per item charge to Rush an order (requires separate paypal invoice)\r\n&gt; If you wish to expedite the shipping, please let me know and I will get the necessary estimates.\r\n\r\n\r\nWhen you purchase any item that is made to order it will not be exactly as the one you see in the picture.\r\nIf you see an item you like and would like it in a different color, size or style, please contact me.  I have a fair sized/varied selection of hides in terms of color and finish, so not all of them are pictured in any one listing.  Please message with questions or request custom order, I will do my best to fulfill your requests within the best of my abilities and stock.\r\n",
