"title": "Chainmaille Triforce Dice Bag With Flames",
"description": "I had a customer request a dice bag with black, white and orange, and she wanted a Triforce.  I&#39;ve had this flame dice bag brewing in my head for a while now, so I had the idea to combine the two.  It&#39;s maximum geekery in one place - chainmaille, Legend of Zelda, and fiyaaaaaahhhhh!   You know you want to set everything on fire, Trogdor the level 1 wizard.  You&#39;re the Burninator and you deserve a dice bag that reflects your heart&#39;s desire.\n\nWell, this will certainly maximize your fireball.  While it&#39;s not a dice bag of holding, the medium size should keep up to 40 standard dice and the large version 70+ dice without a problem, and unless you have some insanely tiny dice, they won&#39;t slip through the holes.  If you need a larger version of this, send a message.\n\nThere is also a version of this without the Triforce, just flames.  If you don&#39;t see the listing let me know.\n\nChainmaille items are guaranteed; if the finish wears off the rings or one happens to break, I do repairs for the cost of shipping the item.\n\nA note, because of the spontaneous nature of me weaving fire, your bag may not look exactly like this (at least the fire part).  If you have an idea for a custom bag and you don&#39;t see the listing, drop me a note, I enjoy working with customers to make the perfect thing.",
