"title": "You&#39;ve Got Maille - Unique Chainmaille and Wirework ",
"announcement": "I make chainmaille and wire jewelry, &quot;geek chic&quot; items, costume items, geekery (dice bags, hacky sacks, gaming accessories), Victorian and Renaissance items, other accessories and home items.\r\n\r\nChainmaille fascinates me.  It&#39;s slinky, tactile, touchable.  I love making things in bright colors, rainbow colors, and also sterling silver and stainless steel.  But my favorite is hypoallergenic niobium.\r\n\r\nI also make wire wrapped jewelry, weaving wire and with a lot of trademark loops and swirls.  I enjoy using semiprecious stones and crystals, and love learning about the metaphysical properties of each stone -- not just a kind of stone (like quartz), but getting to know each individual one.\r\n\r\nI enjoy doing custom work so I am always interested to hear if you have a stone, coin, or other item that is important to you that you would like me to wire wrap in my signature style.  I also do chainmail in various colors and materials upon request, so please drop me a line if I can be of help.\r\n\r\nThank you for stopping by!\r\n\r\nYou can find my website at http://wwww.youvegotmaille.net\r\nand Facebook at http://www.facebook.com/youvegotmaille\r\n\r\nIf you happen to find yourself in little Sparta, Tennessee, you can see my work for sale at Fragrant Mushroom Gallery, 12 W Bockman Way (across from the courthouse).  It&#39;s got lots of handmade things for sale so if you enjoy hand made drop by!\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Will return from visiting my family in Ohio August 10.  Till then, stay safe!",
"sale_message": "Thanks very much for your purchase!  We&#39;ll get it to you as soon as humanly possible.  If you have any questions or problems please contact us and we&#39;ll do the best we can to rectify your concern.",
"digital_sale_message": null,
