"accepts_custom_requests": true,
"policy_welcome": "We make stuff out of little metal rings.  What this means is, if you visit our house, you&#39;re likely to step on a little metal ring somewhere, because we&#39;re constantly dropping them.  One of these days we are going to sweep the floor and make something out of the odd assortment of things we find.  Minus the dog hair.",
"policy_payment": "Payment is expected within a few days of the closing of a sale, otherwise we send out the Armored Teddy Bear Squad to find you.  You don&#39;t want that.  They have pointy things.",
"policy_shipping": "We ship within two days after receiving payment.  We haven&#39;t listed any international shipping rates because we&#39;re sort of ignorant about shipping internationally.  We&#39;ll charge you what it costs us, plus packing material fees.",
"policy_refunds": "You want to send it back?!  But.. but... I thought it had finally found a good home.... :(\r\n\r\nRefunds are accepted if you&#39;re not satisfied with an item, usually for two weeks after you&#39;ve received it.  Your expense on the shipping.  We&#39;ll refund your money or replace the item.  Beyond that.. send a Conversation at me, we&#39;ll talk.  I&#39;ll bring the coffee.",
"policy_additional": "Custom orders, yes.  We&#39;ll do our best, anything you want.  If you have a pendant that simply must have chainmaille to go with it, we&#39;re your mans.  Custom materials, beads, etc., sure thing.  We&#39;ll try armor.  Coif.  Bracers.  Belts.  If you can imagine it, and it&#39;s made of little rings, we&#39;ll pick them up off the floor and start making it.\r\n\r\nKidding.  All kidding aside, we would LOVE to brainstorm your custom item with you and attempt to bring it to reality.",
