"title": "OwlBear Cub Art Doll - Handmade OOAK Plush",
"description": "Aw, look at this little fella! This sweet owlbear is only a baby. He needs someone to take care of him until he can grow up to be a terrifying abomination. \n\nJasper the Owlbear is a one of a kind art doll, completely handmade and sewn from a pattern of my own design. His face is sculpted from Cernit polymer clay and embedded with real feathers. He has hand-painted glass eyes and his body is sewn from thick, multicolored faux fur. He is stuffed with fiberfill and plastic pellets. He has talon-like claws in his feet and hands, also made from polymer clay. Jasper measures 16&quot; long and is sewn into a sitting position. He is not poseable. \n\nJasper is a realistic, one of a kind (OOAK) art doll. He was created by artist Alia Bierwag (that&#39;s me!) for Outpost 8. He is very cuddly but has semi-fragile parts and is meant for display and not a toy for children.\n\nThe price of shipping includes USPS Priority Mail, insurance, and delivery and signature confirmation. Your new owl bear plush is Ready to Ship (RTS) and will be packaged carefully and shipped within 2 days of your order. He should arrive in 2-3 days. (International orders take 1-4 weeks.)\n\nHandmade, one of a kind art plushies such as Jasper make great, unique gifts! He would be perfect for any doll or animal lover or D&D fan. It&#39;s easy to picture him keeping you company during your next gaming session, peering down at you from a ledge, or wherever you please. I&#39;m sure you&#39;d have the perfect spot for him!\n\n* If you would like to set up a payment plan for Jasper, please send me a message and I will be happy to oblige. \n\nA portion of the revenue I make from each of my dolls goes to support the Friends of the Earth charity: http://www.foe.org/",
