"description": "You are commissioning me to construct a wonderful gnome door / faerie door for the Wee Folk in your garden or home.\n\nThis charming fairy door door is approximately 5.5 inches high by 3.5 inches wide. It is constructed by me with care from 3/4 inch solid pine or select ply board. This door can also accommodate pixies, elves, hobbits, and even the tooth fairy. :)\n\nPlease note: Because this item is hand made, the one you receive MAY vary slightly from the one in the picture...but will essentially look the same. :)\n\nThese doors also look great against the skirting of a house, or even on a shelf. You can easily attach the door to any surface using the keyhole slot on the door&#39;s back panel.\n\nThis door does not open except for the &#39;Wee Folk&#39; that dwell within. :)\n\nI will happily combine shipping on multiple orders and any excess shipping you pay is reimbursed when your package is mailed. If you wish to order multiple items and would like me to create a listing that includes your items with a combined shipping charge, just convo me and I will be happy to do so.\n\nPlease allow me up to 2 weeks to have construction finished and the item packaged and ready to mail! This is a good faith estimate of time needed to make your item. Depending on how busy I am, it might be quicker, or it could be a bit longer. Convo me if you&#39;re concerned about meeting a specific deadline. \n\nThank you. :)",
