"title": "Wood, and nothin&#39; but! :)",
"announcement": "Please heed processing times when ordering.  Thank you. :)",
"currency_code": "CAD",
"is_vacation": false,
"vacation_message": "My shop is on vacation until the middle of July. Thank you. :)",
"sale_message": "Thank you for your purchase!\r\n\r\nPaypal or direct checkout is the preferred method of payment. If paying by cheque or money order please advise me in a note so I can keep an eye out for its arrival. Non-Canadian. residents, don&#39;t forget to convert the CAD amount of the order (to put on the cheque) to your country&#39;s currency. You can find a universal currency converter here:\r\n\r\nhttp://www.xe.com/ucc/ \r\n\r\n***I will reimburse any excess shipping fees!\r\n\r\nI strive to make every order a pleasant experience for my customers.  If there is ANY problem at all, don&#39;t hesitate to contact me at my e-mail.\r\n\r\nI take pride in my woodcraft and I hope it will be reflected in the item YOU ordered.\r\n\r\nPlease note **** I am in Canada, so packages headed for the USA will take between 10 and 14 business days to clear customs before being delivered to you.  Average shipping time to the USA seems to be in the area of 2.5 weeks (Canada Post to YOUR door).\r\n\r\nThank you again!\r\n\r\nKerry. :)",
"digital_sale_message": null,
"last_updated_tsz": 1429465798,
"listing_active_count": 32,
"login_name": "NothinButWood",
"accepts_custom_requests": false,
"policy_welcome": "Welcome friends! \r\n\r\nMy name is Kerry Roberts.  I am the person behind the saw who cuts, sands, paints, stains, decorates, packs and sends all the creations you see in my store.  :)\r\n\r\nAbout my work:\r\nWood - As my ID &quot;nothinbutwood&quot; suggests, all the items in my store are made exclusively from wood, or at least are comprised mostly of wood. \r\n\r\nMost of the items in my store fall into the category of out-of-doors &#39;Wee Folk&#39; (i.e. gnomes, fairies, etc) garden accessories.\r\n\r\nI enjoy creating the items for this little niche VERY much.  I always use solid pine board or high quality plywood for all my creations.  All of the items fare just fine being outside.  I would recommend applying a clear weather seal at least once a year to extend the life of the wood.\r\n\r\nAll of my items are listed with a quantity of 1.  \r\n\r\n*** IF YOU WISH TO ORDER MULTIPLES OF AN ITEM, JUST CONVO ME AND I&#39;LL DO A CUSTOM LISTING FOR YOU, THAT WILL ALSO INCLUDE THE COMBINED SHIPPING.***\r\n\r\nPlease heed the processing times listed in my items.  This time is an average estimate of how long it will take me to process your order based on the number of orders I have ahead of yours.\r\n\r\nI always try to get the orders out as quick as I can.  However, I am just one person, and I have a family and a day job in addition to my hobby.  I won&#39;t sacrifice quality for quantity so there may be times you will have to wait a little longer than normal.\r\n\r\nIf you are concerned about a timeline, don&#39;t hesitate to drop me a line.  :)",
"policy_payment": "Direct payment and Paypal are the preferred methods of payment.\r\n\r\nIf paying by cheque, please make the cheque payable to me, Kerry Roberts...not my Etsy id.  My bank will not cash cheques made out to &#39;NothinButWood&#39; :)\r\n\r\n***PLEASE PLEASE ensure the address you enter on your order is correct.  Time does not permit me the luxury of manually verifying or changing addresses.  If your address is correct, notify me and I will cancel your order and you can resubmit with the correct address.",
"policy_shipping": "I ship via Canada Post and all packages are insured up to $100.  Additional coverage is available at $1 for every $100.\r\n\r\nTracking is NOT available on &quot;small packets US&quot; or &quot;small packets international&quot;.  If you wish to have tracking,  advise me BEFORE purchasing and I will let you know a shipping rate for a &quot;tracked&quot; package to your location.\r\n\r\nShipping from Canada to the US can take 2-3 weeks on average (and sometimes up to 6 weeks).\r\n\r\nShipping from Canada to overseas destinations can take 3-4 weeks on average (and sometimes up to 8 weeks).",
"policy_refunds": "Your complete satisfaction is very important to me.  I work very hard to ensure each piece I craft meets, and hopefully exceeds, your expectations.  Because all my pieces are handmade, there may be slight variations in the piece you receive.  For example, the wood stain may look slightly different, or the accessories used to decorate the piece may vary slightly.\r\n\r\nIf you are not satisfied, for any reason, with your purchase, don&#39;t hesitate to contact me.",
"policy_additional": "I welcome custom orders by all means.  Please feel free to ask &#39;can you make this?&#39;  :)",
