"title": "Monster Dice Bag Dungeons and Dragons Spider Plush Drawstring Pouch d20",
"description": "This adorably creepy creature is hungry... for dice, coins, damage counters or small miniatures! This makes it the perfect companion for gaming events, cosplay, conventions or everyday use.\n\nIts body is made out of brown faux fur, with a combination of fleece and felt details. The outer fangs are stuffed with polyfill to keep their shape, and the inside teeth are made of felt, so you don&#39;t have to worry about carrying a venom antidote around while you&#39;re gaming.\n\nThe six eyeballs are attached by careful machine applique, and it has a drawstring closure. The dice in the photos are shown for size reference.\n\nEach one is carefully crafted using a combination of machine and hand stitching for the finer details. It is handmade to order and will differ slightly from one another.\n\nAs with all my items, this spider-like monster dice bag is one of a kind and created using 100% cruelty-free vegan materials.\n\nTo see other cute creature accessories I have available, visit my shop:\n\nCraftedCreatureShop.etsy.com\n\nIf you have a different creature or character you would like to be made in to a dice bag, message me for a custom order!",
