"title": "Lab Arc Designs ",
"announcement": "RPG Dice, jewelry, painting, crochet and other odds and ends crafted and designed by Laura Cushing. \r\n\r\nVintage pattern downloads,  vintage games, antique books, and accessories. \r\n\r\nWelcome to our shop.\r\n\r\nFun times for all!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for purchasing from Lab Arc Designs! Please contact us if you have any questions, or if you would like to arrange a custom style or color for an item that allows customization. \r\n\r\nAll handcrafted items are made with love and care.  \r\n\r\nWhether you are purchasing something hand made, or a vintage item, we are so thankful for your business and hope you will enjoy your purchase for many years to come. \r\n",
"digital_sale_message": "Thank you for purchasing a digital download from Lab Arc Designs. All our patterns are vintage (20 years or older), and have been converted to PDF for ease of use.  Full color has been preserved on patterns that are in color, as have all illustrations.\r\n\r\nPlease let us know if you have any questions or difficulties with your file  - we will be happy to assist you. ",
"last_updated_tsz": 1444579266,
"listing_active_count": 192,
"login_name": "labarcdesigns",
"accepts_custom_requests": true,
"policy_welcome": "We pride ourselves on being friendly and helpful; if you would like to arrange to have several items shipped together, or need something expedited, please just send us a message and let us know.\r\n\r\nLikewise, if you see something that you like in a color that isn&#39;t right for you - talk to us about a custom order!\r\n\r\nIf you are international and want to make a purchase,  we can work with you! Contact us.\r\n\r\nThank you for shopping with us.",
"policy_payment": "We accept PayPal and all major credit cards. If you want to cancel an order, please let us know and we will refund. If you want to return a received order, please see our refund policy.",
"policy_shipping": "We ship standard US mail in most cases, but to zones where priority isn&#39;t that much of a difference we will upgrade your shipping for free! Insurance and confirmation provided at customer&#39;s request for higher end or  unique items.\r\n\r\nFor international purchase and shipping, please contact us and we&#39;ll take your item to the post office and price shipping for you.",
"policy_refunds": "For damaged items:\r\n\r\nPlease contact us with pictures of the item&#39;s current condition. If it can be fixed, we may ask that you ship it back to us at our cost.  \r\n\r\nIf item is shipped insured, we will ask that you either claim the postal insurance or allow us to claim the insurance on your behalf.\r\n\r\nDO NOT THROW OUT ITEM OR PACKAGING.\r\n\r\nIf item arrives damaged and was uninsured,  we will be happy to issue a refund or a replacement item. \r\n\r\nFor Lost Items:\r\nIf item is lost in mail, please contact us and we will try to track it down.\r\n\r\nIf you receive it and change your mind,  you may ship it back to us within two weeks and we will refund your money (minus our shipping costs).\r\n\r\nFor Custom Orders:\r\nFor custom orders, a picture(s) of the order will be shown to you so you can decide if it is indeed what you wanted.  Once you approve the preview and purchase the item, no refund will be issued except in cases of damage or loss.\r\n\r\nFor Vintage Items:\r\nVintage items are sold &#39;as is&#39;  with no refund except in case of loss - but every effort will be made to accurately describe the item&#39;s current condition.\r\n\r\nFor Downloads:\r\nNo refunds will be made on digital pattern downloads. If you have trouble opening your file, please contact us and we will walk you through .pdf use or send you a new version of the file as needed.",
"policy_additional": "Most dice, jewelry, crochet items (and some painted items) can be custom ordered. Please let us know if there&#39;s a set of colors and / or a design that you have your heart set on.\r\n\r\nIf you are looking for a particular type of pattern that we don&#39;t have in stock to download, please let us know! We have a large library of vintage patterns that we are in the process of converting to PDF. We&#39;re happy to search out one that you are looking for.\r\n\r\nIf you are not satisfied for any reason, please contact us! We will work it out.\r\n\r\nWondering where Lab Arc Designs (the name) comes from? The initials of my maiden name (LAB) and my husband&#39;s name (ARC) have been used for our various ventures since we got together in 1997!",
"policy_seller_info": "Laura Cushing \r\nLab Arc Designs\r\nemail:  ourlostprophet@gmail.com",
