"accepts_custom_requests": true,
"policy_welcome": "I make all of my items individually, by hand with a special process I have developed over many years of trial and error.  The high quality image is covered with a heavy epoxy resin.  This unique process makes for a vivid image that is protected from the elements. I have been creating art for 30 years, andI want you happy, so I guarantee my items with an exchange or full refund. You won’t find another item exactly like mine.",
"policy_payment": "I accept Paypal (preferred), or etsy direct checkout. Payment must be made within 5 days of purchase. A 6.75% sales tax is added on to sales in Minnesota. If you wish to cancel the order you must inform me within 24 hours, due to the fact that all items are made to order for you. I cant guarantee the time it will take to arrive to countries out of the usa, as customs policies are different everywhere. If for some reason you dont receive your items within a reasonable amount of time after notification of shipment please email me and let me know.",
"policy_shipping": "IF YOU ARE OUT OF THE USA YOU MUST PROVIDE ME WITH A PHONE NUMBER FOR SHIPPING!!!!!!!!!!!\r\n\r\nI ship with the USPS first class air mail. I will ship priority or express mail at your request for an additional fee. Just write to me so I can get you the cost. All items out of the USA will also be shipped with the USPS first class air mail. I will ship priority or express mail out of the USA. Please email me for cost . Shipping to Italy and Mexico is sent registered mail only, due to many losses in these countries and then I can guarantee it will arrive.\r\n\r\nPLEASE if you are out of the USA i need a phone number so leave me this info in the comments section of the checkout\r\nI cant guarantee the time it will take to arrive to countries out of the usa, as customs policies are different everywhere. If for some reason you dont receive your items within a reasonable amount of time after notification of shipment please email me and let me know.",
"policy_refunds": "100% satisfaction guarantee.  If you are not happy with your item you may return it within 30 days for a exchange or full refund minus the shipping charge.",
"policy_additional": "When making a special order I ask that you email me the image you want on the item. Please do not try to crop or size the item.  I will do all that work for you. I ask that the image be as large as possible, as this will make for a better quality image, and you may send it in any format although a jpg is preferred. You may email the image to angelafabio@hotmail.com or write for any questions you may have at any time. If you want to purchase a large quantity please email me for pricing.",
"policy_seller_info": "angela fabio\r\n14319 brookmere blvd nw\r\nprior lake, mn 55372\r\nangelafabio@hotmail.com",
