"policy_welcome": "Welcome to the magical realm of High Heorot. Here, you will find wearable art inspired by Dragons, Elves, Fae, Myth and Magic. \r\nI create magical pendants using the highest quality metals, polymer clay and supplies made in the United States.",
"policy_payment": "I accept Paypal, credit cards and Etsy gift cards. Payment is due within 24 hours of purchase or order will be canceled. If you would like to reserve an item, set up a payment plan (only for orders over $50) or request a custom listing please send me a message. All messages will be responded to within 12 hours. \r\nI do accept custom orders, but require 25% of payment upfront before I begin creating your item. Payment will only be accepted once you agree upon design and terms.\r\nMost items in my shop are trade friendly.",
"policy_shipping": "All items are shipped within 1-3 business days after payment is received, unless otherwise specified in shop announcement. \r\nPLEASE double check your shipping address. I will NOT be responsible for or send replacement items because of invalid addresses. I print my labels directly from your checkout receipt and ship to the address that you specify.\r\nFor priority shipping, please add the shipping upgrade listing to your cart.\r\nDon&#39;t see your country? Message me for a shipping estimate and once shipped, if shipping is less, you will promptly be refunded through your choice of Paypal or shop credit.\r\nI send everything USPS  first class mail, with tracking in the US.\r\nBecause I am located in the United States, international orders, although not common, can take up to 30 days to arrive. \r\n\r\n",
"policy_refunds": "Please contact me within 3 days after shipping, if there is a problem with your order, or before leaving negative feedback. \r\n\r\nItems must be returned or exchanged within 14 days for a full refund (postage will be at your expense) \r\n\r\nI try to be exact with my measurements in listings, but if something doesn&#39;t fit quite right, I will be happy to adjust it for free but will not cover shipping costs. \r\n\r\nAny damages incurred during shipping, I will repair. You will be responsible for shipping costs, but I will give you store credit in the amount paid for shipping. ",
"policy_additional": "I love custom work! Have an idea or design, or even fancy a sold item? I would love to create it for you. \r\n\r\nJust about everything in my shop is trade friendly. I love connecting with other Etsy sellers!\r\n",
