"title": "CUSTOM Dice Dragon Couple Wedding Cake Topper Made-to-order",
"description": "*** YOU WILL NOT GET THE DRAGONS PICTURED ABOVE! They are an example pair of the cake topper. This listing is for a CUSTOM, one-of-a-kind dice dragon couple cake topper of your chosen colors. ***\n\nPlease choose from the drop down menu what details (or no details) you would like on your topper.  Certain details are not included in the base price. If you want a regular set, you need to purchase the &quot;Undetailed&quot; from the drop down menu. \n\nAlso note: the &quot;Everything&quot; option in the drop down menu includes 1 Veil, 1 Bouquet, 1 Top Hat, and 1 Bow tie \n------------------------------------------------------------------------------------------------\n\nAwwww!\n\nThese pair of dice dragons are holding D20s while going nose-to-nose and forming a heart with their tails.\n\nWhen purchasing this listing, you are buying a custom order and need to give me these details:\n\nDo you want the dragons to have corresponding colors, like the ones pictured? If not specified the dragons will have matching colors to their die as well as their mate.\n\nDragon #1:\nBody colors (I recommend at least three for the swirled effect)\nEye color\n\n\nDragon #2:\nBody colors (I recommend at least three for the swirled effect)\nEye color\n\n\nI will match the dragons with a similar die. If you have a particular die in mind, please also specify but be aware that I may not be able to get it, so secondary options are helpful. I will do my very best and typically have a bunch of colorful d20s in stock. Also if you would rather, I can also get a different type of die- d4, d8, d10, d12, etc..\n\nEach dragon couple will be one-of-a-kind and look different, even from the ones pictured. I will do my best to keep the same shape but each come out unique.\n\nThis is a custom-made set just for you. Please order early, and plan for 2-3 weeks construction (I work 2 jobs in addition to this) and 2-5 days shipping in the US, 2-3 weeks shipping Canada. If you need your order sooner, please add on our &quot;Rush Order&quot; listing. This being said, I will do my best to have it out to you as quickly as possible.",
